      (5937, '核心測驗美食店5937', 14, 102, 3, '冰涼徹底', '五月雪保留客家料理的精髓，但在口味上趨近清淡所以店內102餘道客家菜風味道地，又可口也不會太油又太鹹。店內的菜色很多元，兼具傳統與創新， 除了必嘗的外婆醬肉、白斬放山雞、醬筍炆鮮魚、和風鹹豬肉之外，想來點不同的還可以點選店家的私房菜，依四季調整的當季食材，每每總讓人驚豔。我們菜色上不僅求新求變，還要不失客家風味，而且還要好吃。所以師傅們就得花更多的工序與心思在菜色上，讓菜色更加美味。 「我們嚴選台灣各地上等的食材，將最好的料理奉獻給客人，讓客人下次繼續光顧，是我們的服務理念。」', '23.973202,121.584183', '0X15-0X4-XX5', '花蓮縣花蓮市XX路XX巷XX樓', 'XX站走路15分鐘！！', '星期六公休', '15:00~23:00', '可包廂、可預約', '2018-05-12 19:16:00', '2018-05-12 19:16:00'),
